import React from 'react';
import '../style/App.css';

function App21() {
    return (
        <div className="container">
            <div class="landing-text">
                <h2>FURTHERMORE</h2>
            </div>
            <div class="furthermore-text">
                <p>1) Introduce myself</p>
                <p>2) Start with where i was raised</p>
                <p>3) High school graduation and how I chose coding</p>
                <p>4) How I ended up in America</p>
                <p>5) How College is going</p>
                <p>6) Summary</p>
            </div>
        </div>
    );
}

export default App21;
